int  add(int arr[4], int chek[],int size)
{
    int a = arr[0] * 1000 + arr[1] * 100 + arr[2] * 10 + arr[3],f=-1;
    for (int i = 0; i < size; i += 2)
    {
        if (chek[i] == a)
        {
            chek[i + 1]++;
            f = 0;
            break;
        }
    }
    if (f == -1)
    {
            chek[size - 2] = a;
            chek[size - 1] = 1;
    }
    return f;
}
